import React from 'react'
import "./header.css";

import {Container,Row,Button} from 'reactstrap';
import { NavLink,Link } from 'react-router-dom';

const nav_links =[{
  path:'/home',
  display:'Home'
},
{
  path:'#',
  display:'About'
},
{
  path:'/tours',
  display:'Tours'
},
{
  path:'/tours/:id',
  display:'TourDetails'
},
{
  path:'/login',
  display:'Login'
},
{
  path:'/register',
  display:'Register'
},
{
  path:'/tours/search',
  display:'SearchResult'
},
]

const Header = () => {
  return <header className='header'>
    <Container>
      <Row>
        <div className="nav-wrapper d-flex align-items-center justify-content-between">

          {/* logo */}
            <div className="logo">
              
            </div>

        </div>
      </Row>
    </Container>

  </header>
}

export default Header
